import React from "react"
import style from "./NewPost.module.css"
import {Field, reduxForm} from "redux-form";

const NewPostForm = (props) => {
    return (
        <form onSubmit={props.handleSubmit} className={style.newMessage}>
            <div>
                <Field component={"textarea"} name={"messageText"} placeholder="Write your post text"/>
            </div>
            <div>
                <button>Post</button>
            </div>
        </form>
    )
}

const NewPostReduxForm = reduxForm({form: "messageText"})(NewPostForm)

const NewPost = (props) => {
    console.log(props)
    let post = (values) => {
        console.log(values)
    }
    return (
        <div>
            <h1>add post</h1>
            <NewPostReduxForm onSubmite={post}/>

        </div>
    )
}

export default NewPost
